window.bookSummaryJSON = "<p><b><i>She's the wife he never wanted...and the weakness he never saw coming.</i></b></p> <p>Ruthless. Meticulous. Arrogant.</p> <p>Dante Russo thrives on control, both personally and professionally.</p> <p>The billionaire CEO never planned to marry—until the threat of blackmail forces him into an engagement with a woman he barely knows.</p> <p>Vivian Lau, jewelry heiress and daughter of his newest enemy.</p> <p>It doesn’t matter how beautiful or charming she is. He'll do everything in his power to destroy the evidence and their betrothal.</p> <p>There’s only one problem: Now that he has her...he can't bring himself to let her go.</p> <p>***</p> <p>Elegant. Ambitious. Well-mannered.</p> <p>Vivian Lau is the perfect daughter and her family’s ticket into the highest echelons of high society.</p> <p>Marrying a blue-blooded Russo means opening doors that would otherwise remain closed to her new-money family.</p> <p>While the rude, elusive Dante isn't her idea of a dream partner, she agrees to their arranged marriage out of duty.</p> <p>Craving his touch was never part of the plan.</p> <p>Neither was the worst thing she could possibly do: fall in love with her future husband.</p> <p><i>King of Wrath </i>is a steamy arranged-marriage billionaire romance. It includes explicit content and profanity. Recommended for mature listeners only.</p>"; 
